import SearchProduct from './component/SearchProduct'
function App() {

  const carList = [
    { brand:"BMW", color:"Red"  },
    { brand:"Ford", color:"Blue"  },
    { brand:"Tesla", color:"Green"  },
  ]

  return (
    <>

    <SearchProduct/>

      <SearchApp/>
      <LowCodeForm />
      <BlogPage carList = {carList}/>
      <Car carList = {carList}/>

      <div>
        {/* <LeftMenu /> */}
        <div>Main Content</div>
      </div>
    </>

  );
}

export default App;
